    [],nt"num_tags": 15,nt"name": "presquile-national-wildlife-refuge-annual-narrative-report-fiscal-year-1974",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Presquile
    National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    mammals, raptors, fish, reptiles, and diseases- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and collections
    and receipts. Resource management is outlined; topics include haying and commercial
    fishing. A progress report on field investigations and applied research is also
    provided. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, and violations. Items of interest
    and photographs are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
